import * as React from "react";
import logo from './CSVValED.png';localStorages

class Heading extends React.Component {
    render() {
        return (
            <h1 class="text-center">
                <span class="badge bg-warning" id="help" data-bs-toggle="modal" data-bs-target="#modalHelp" role="button">
                    <img src="/images/questionMark.svg" />
                </span>

                <a href="/">
                    <img src="/images/CSVValED.png" alt="CSVValEd" />
                </a>

                <span class="badge bg-primary" id="about" data-bs-toggle="modal" data-bs-target="#modalAbout" role="button">
                    <img src="/images/exclamationPoint.svg" />
                </span>
            </h1>
        );
    }
}

export default Heading;
